INSERT INTO `tasks` VALUES (1,1412261843,13,'App store review task','This task is for the App Store approval process.',NULL,'national',NULL,NULL,NULL,1412261843,1412521043,1418283583,'UTC',5,'photo,text,video,audio','free',0.00,NULL,5,'closed',0,1),(4,1412611764,13,'This is a welcome task for new registered users.','Thanks for downloading Newsreps. For you to fully understand how the app works follow each step here. You are located somewhere in the world - Please submit any contents you want, like what is happening right now. It\'s as simple as that, just click below to start.','Welcome','international',NULL,NULL,NULL,1412611764,1444176000,NULL,'UTC',0,'photo,text,video,audio','free',0.00,NULL,20,'live',0,2),(5,1412674013,13,'Test','This is a test task.',NULL,'national',NULL,NULL,NULL,1412674013,1412760413,1412674694,'UTC',5,'photo','free',0.00,NULL,5,'closed',0,3),(6,1412674767,13,'Test 2','Another test',NULL,'national',NULL,NULL,NULL,1412674767,1412761167,1412674814,'UTC',5,'photo','free',0.00,NULL,5,'closed',0,4),(7,1412676053,13,'Newsreps needs your help','We need pictures, video and a short description of how you work and would like to work with User Generated News. \nWe prefer pictures or videos where we can see User Generated News in the making i.e action shots.','UserGeneratedNews','international',NULL,NULL,NULL,1412676053,1416308453,1418283541,'UTC',0,'photo,text,video','paid',200.00,'EUR',20,'closed',0,5),(8,1413372752,13,'The situation in middle east  - How is it connecte','The current situation in the middle east is effecting much more people that earlier estimated. With Syria as the center of attention, there are many people fleeing to the neighboring countries but not only from Syria. We are working on a piece where information on how people around the world have a connection to the conflict. Are there relatives, people on sight that you know and other implications in your life as a result of the conflict. \n\nWe need all types of content and information. But please, try to explain what it is you are sending in, where and when.','Syria,war,is,isis,islam','international',NULL,NULL,NULL,1413372752,1415187152,1418283521,'UTC',0,'photo,text,video,audio','paid',200.00,'EUR',20,'closed',0,6),(9,1415377086,13,'كيف هي حالة الشارع اليبي بعد الانتخابات؟؟','نحن نحقق الان في الوضع بعد الانتخابات في ليبيا. هل تغير الوضع؟ هل هذا التغيير للافضل ام للاسوأ ؟ ماهي التغيرات التي لاحظتموها ؟ نحن نرغب في الحصول على صور او فيديو من المنطقة التي تسكن بها .اكتب لنا و تحدث كيف هو الوضع الان.',NULL,'national',NULL,NULL,NULL,1415377086,1417191486,1417423664,'Europe/Stockholm',10,'photo,text,video','paid',200.00,'EUR',10,'closed',0,7),(10,1417018319,13,'Your views on Gender Equality','Recently focus has been put on gender inequality both politically and in media. Have you experienced or seen any events confirming this issue? Do you think that gender equality is different now from 10 years ago? Please send in your personal story or thoughts. Don’t forget to add photos or videos of an example or actual situation.','gender,equality,discrimination','international',NULL,NULL,NULL,1417018319,1418832719,1418283501,'Europe/Stockholm',5,'photo,text,video,audio','paid',200.00,'USD',5,'closed',0,8),(11,1417448102,13,'Welcome task','This is a task for welcome.',NULL,'national',NULL,NULL,NULL,1417448102,1417534502,1417510317,'Europe/Stockholm',5,'photo,text,video,audio','free',0.00,NULL,5,'closed',0,9),(12,1417683228,13,'test 2',NULL,NULL,'national',NULL,NULL,NULL,1417683228,1417769628,1417686506,'Europe/Stockholm',5,'photo,text,video,audio','free',0.00,NULL,5,'closed',0,10),(13,1417683580,13,'test 3',NULL,NULL,'national',NULL,NULL,NULL,1417683580,1417769980,1417686496,'Europe/Stockholm',5,'photo,text,video,audio','free',0.00,NULL,5,'closed',0,11),(14,1418653813,13,'The holiday season','It is time for the holidays, which includes decoration, presents and other traditions. We are interested in how you will spend the holidays, have you decorated in any special way? How many percent of your salary in December goes to gift shopping? Please include photos of the holiday spirit where you live, from store fronts, streets or just your take on the holidays.','Christmas,2014','international',NULL,NULL,NULL,1418653813,1419949813,1420488905,'Europe/Stockholm',10,'photo,text','paid',200.00,'EUR',10,'closed',0,13),(15,1418718326,13,'test task','(No content)',NULL,'national',NULL,NULL,NULL,1418718326,1418804726,1418721271,'Europe/Stockholm',5,'photo,text,video,audio','free',0.00,NULL,5,'closed',0,14),(16,1420476236,13,'Superman drug - a global threat.','We need to know more about the superman drug and its whereabouts.\nSo please help us, do you know anything about this drug? \nIs it available in your area or country?\nHave you been offered to try it?\nBe creative and submit information relevant to this task, pictures if possible.','Supermandrug,Superman','international',NULL,NULL,NULL,1420476236,1422290636,1426623046,'Europe/Stockholm',10,'photo,text,video,audio','paid',200.00,'USD',10,'closed',0,15),(17,1420713585,13,'Blizzard alert in the middle east.','We are interested in how the cold and snowy weather have affected your area.\nPerhaps you stayed home from work or got stuck in traffic?\nSubmit pictures, video and perhaps a story.','blizzard,snow,weather','international',NULL,NULL,NULL,1420713585,1422527985,1426623040,'Europe/Stockholm',10,'photo,text,video,audio','paid',100.00,'USD',10,'closed',0,16),(18,1421168021,13,'Acts of terrorism','Have you or someone you know encountered any acts of terrorism?\nWe are investigating the spread of it and if you have any information please share.\nHave the authorities been helping or shared information?\nPlease describe and send in pictures, video and audio with your story.','Terrorism','international',NULL,NULL,NULL,1421168021,1422982421,1426623035,'Europe/Stockholm',0,'photo,text,video,audio','paid',200.00,'USD',20,'closed',0,17),(19,1421248498,13,'Heavy rain and floods in eastern Africa','Are you in the area of the heavy rain or floods?\nHave you been affected?\nPlease send in pictures, video and describe the situation.','weather,flood,disaster','local',41.0863,-19.419,999.999,1421248498,1422112498,1426623029,'Europe/Stockholm',10,'photo,text,video,audio','paid',100.00,'USD',10,'closed',0,18),(20,1421672673,243,'Test','Test',NULL,'local',72.5146,23.0388,10.000,1421672673,1421759073,1421673628,'Asia/Beirut',5,'photo','paid',1500.00,'SEK',5,'closed',0,19),(21,1422261082,13,'Protests in Egypt','Please send in pictures and video from these events.\nAny information is appreciated.','protests','international',NULL,NULL,NULL,1422261082,1423125082,1426623024,'Europe/Stockholm',10,'photo,text,video,audio','paid',100.00,'USD',10,'closed',0,20),(22,1422284683,13,'Blizzard alert in the US','We welcome any pictures or video of the expected snow weather.\nWhat\'s the situation where you are at? Does it affect your living, daily routines or traffic?',NULL,'national',NULL,NULL,NULL,1422284683,1423148683,1426623020,'Europe/Stockholm',10,'photo,text,video,audio','paid',100.00,'USD',10,'closed',0,21),(23,1422543480,13,'Super Bowl XLIX','It is time for the Super Bowl, which includes preparation, snacks and traditions. \nWe are interested in how you will prepare and cheer for the teams. Have you planned this event in detail or perhaps you\'ve got tickets? Send in pictures and video of your preparations and the game itself.','superbowl','international',NULL,NULL,NULL,1422543480,1423148280,1426622933,'Europe/Stockholm',5,'photo,text,video,audio','paid',100.00,'USD',10,'closed',0,22),(24,1423060303,13,'Demo task NTV','This is a task for introducing the service in Lebanon','lebanon,ntv,beirut','local',35.6058,33.9439,59.884,1423060303,1423319503,1426622916,'Europe/Stockholm',10,'photo,text,video,audio','paid',200.00,'USD',10,'closed',0,23),(25,1423152042,13,'Welcome task in Angola',NULL,NULL,'national',NULL,NULL,NULL,1423152042,1423238442,1423152151,'Europe/Stockholm',5,'photo,text','free',0.00,NULL,5,'closed',0,24),(26,1423228620,13,'TEST TASK LBC','This is test task !',NULL,'local',35.6463,34.0414,9.727,1423228620,1423315020,1426622911,'Europe/Stockholm',5,'photo,text,video,audio','paid',100.00,'USD',5,'closed',0,25),(27,1423478507,13,'Clash at stadium in Cairo','Do you have any information on this occurance?\nWere you at the stadium when it happened? \nPlease send in your personal story, don\'t forget to attach photos or video.',NULL,'international',NULL,NULL,NULL,1423478507,1424083307,1426622905,'Europe/Stockholm',5,'photo,text,video,audio','paid',100.00,'USD',5,'closed',0,26),(28,1423671711,13,'Melodifestivalen','Vi är intresserade av hur du följer Melodifestivalen.\nFinns det några årliga traditioner eller blir det en vanlig hemmakväll framför din tv?\nSkicka in bilder och video som fångar stämningen och beskriv gärna vad som gör en \"mello\"-kväll så speciell.','Eurovision','international',NULL,NULL,NULL,1423671711,1425486111,1426622894,'Europe/Stockholm',10,'photo,text,video,audio','paid',1500.00,'SEK',10,'closed',0,27),(29,1423760816,13,'test',NULL,NULL,'national',NULL,NULL,NULL,1423760816,1423847216,1423760882,'Europe/Stockholm',5,'photo,text,video','free',0.00,NULL,5,'closed',0,28),(30,1424255982,294,'حماس ترفض شروط الرباعية',NULL,'شروطبلير,رسالةطمأنة','international',NULL,NULL,NULL,1424255982,1424342382,1424256026,'Asia/Jerusalem',5,'text','paid',1500.00,'SEK',20,'closed',0,29),(31,1425289452,13,'Boris Nemtsov memorial','We are interested in coverage of the Nemtsov tribute march.\nPerhaps you are participating or watching it from home?\nSend in pictures, video or share your personal story regarding this tragedy.','russia,moscow','international',NULL,NULL,NULL,1425289452,1426153452,1426623015,'Europe/Stockholm',5,'photo,text,video,audio','paid',100.00,'USD',5,'closed',0,30),(32,1425291921,13,'The conflict','We are very interested in how the conflict has affected you, your family and friends.\nHas it changed your life, daily routines or surrounding environment?\nPlease send in photos, video or write a personal story.','war','international',NULL,NULL,NULL,1425291921,1427106321,1427148476,'Europe/Stockholm',10,'photo,text,video,audio','paid',200.00,'USD',5,'closed',0,31),(33,1425292048,13,'The conflict','We are very interested in how the conflict with Russia has affected you, your family and friends.\nHas it changed your life, daily routines or surrounding environment?\nPlease send in photos, video or write a personal story.','russia,ukraine','international',NULL,NULL,NULL,1425292048,1427106448,1427148382,'Europe/Stockholm',15,'photo,text,video,audio','paid',200.00,'USD',5,'closed',0,32),(34,1425304294,13,'Activity at the Syrian border','We are interested in information regarding the recent development at the Syrian border.\nAre you affected in any way? Have you seen or heard anything?\nPlease send in photos, video or your story.','Syria,ISIS','international',NULL,NULL,NULL,1425304294,1427118694,1426622865,'Europe/Stockholm',5,'photo,text,video,audio','paid',100.00,'USD',5,'closed',0,33),(35,1425462632,13,'Är vintern över?','Nu när värmen är på väg kan man uppleva riktiga vårkänslor, kommer du vandra längs med stranden eller sitta utomhus under fikapausen? Skicka in dina bilder och filmer som fångar våren.',NULL,'national',NULL,NULL,NULL,1425462632,1427277032,1426622821,'Europe/Stockholm',15,'photo,text,video,audio','paid',1500.00,'SEK',10,'closed',0,34),(36,1425463210,13,'Is spring finally here?','The cold winter is leaving and in comes the spring.\nHow are you enjoying these first warm days of the year?\nAre you taking a stroll round the block or sitting outdoors during breaks?\nSend in photos and video capturing the season.','Spring','international',NULL,NULL,NULL,1425463210,1427277610,1426641404,'Europe/Stockholm',15,'photo,text,video,audio','paid',100.00,'USD',10,'closed',0,35),(37,1425463741,13,'Last days development','We are very interested in how the recent events in Libya has affected you, your family and friends.\nHas it changed your life, daily routines or surrounding environment? Please send in photos, video or share your story.','Libya','international',NULL,NULL,NULL,1425463741,1426759741,1427098867,'Europe/Stockholm',10,'photo,text,video,audio','paid',100.00,'USD',5,'closed',0,36),(38,1425473920,13,'Cape Town fire','We are interested in pictures and video of the fire or the aftermath.\nHas the fire affected you in any way?\nAlso share a personal story if possible.',NULL,'local',20.9407,-27.6495,999.999,1425473920,1426078720,1426622574,'Europe/Stockholm',5,'photo,text,video,audio','paid',100.00,'USD',5,'closed',0,37),(39,1425731678,13,'Test',NULL,NULL,'national',NULL,NULL,NULL,1425731678,1425818078,1425731754,'Europe/Stockholm',5,'photo,text,video,audio','free',0.00,NULL,5,'closed',0,38),(40,1425797192,294,'الإسرائيليين يتظاهرون بتل أبيب لتغيير نتنياهو','تظاهر عشرات الألاوف من الإسرائيليين الليلة في ميدان رابين وسط تل أبيب، وذلك بدعوة من أحزاب اليسار الإسرائيلي للدعوة لتغيير حزب الليكود الحاكم وعلى رأسه بنيامين نتنياهو .وقدر موقع \"والا\" العبري الحضور ب 35 ألفاً ومن شتى أحزاب اليسار ويسار الوسط كحزب \"ميرتس\" وتحالف حزب العمل ومنظمات يسارية أخرى كمنظمة V15 تحت عنوان \"إسرائيل تريد التغيير\".\nوحضر التظاهرة العديد من الشخصيات الأمنية والسياسية البارزة في الكيان ومن بينهم رئيس جهاز الموساد الأسبق \"مائير داغان\" وقائد المنطقة الشمالية الأسبق \"عميرام ليفين\" ، بالإضافة لرئيس بلدية تل ابيب \"رون خولدائي\" .\nورفع الحضور شعارات تدعو لإقصاء حزب الليكود عن السلطة واستبداله بأحزاب اليسار ومن بينها \" يجب تغيير السلطة\"  و \"  نريد انقلاباً الآن\" و \"نريد حلاً سلمياً قبل تحول الدولة لثنائية القومية \" وهكذا .','الإسرائيليينيتظاهرون,تغييرنتنياهو','national',NULL,NULL,NULL,1425797192,1425883592,NULL,'Asia/Jerusalem',5,'text','paid',1500.00,'SEK',5,'live',0,39),(41,1425797344,294,'رُبع الأمريكان لا يعرفون نتنياهو','أظهر أحدث استطلاع للرأي العام الأمريكي جهل 25% منهم بهوية رئيس الحكومة الإسرائيلية بنيامين نتنياهو.\n\nوأعرب 25% من المستطلعة آراؤهم في استطلاع أجراه معهد \"Pew\" الأمريكي عن جهلهم بهوية نتنياهو وماذا يريد من الولايات المتحدة.\n\nودفع الموقع الأمريكي الشهير بمتابعاته لشؤون البيت الأبيض \"The hell\" لوضع عنوان لافت على صفحته \" Netanya-Who?\".\n\nوأظهر الاستطلاع عدم معارضة 38% من الأمريكيين الذين يعرفون هوية نتنياهو لإلقائه الخطاب أمام أعضاء الكونغرس.\n\nفي حين، أظهر استطلاع أمريكي آخر اعتقاد 48% من المستطلعة آراؤهم أنه ما كان يتوجب دعوة نتنياهو لإلقاء الخطاب في الكونغرس قبل إبلاغ الرئيس الأمريكي باراك أوباما بالأمر.',NULL,'local',-1,-1,-1.000,1425797344,1425883744,NULL,'Asia/Jerusalem',5,'text','paid',1500.00,'SEK',5,'live',0,40),(42,1425797492,294,'جماعة بوكو حرام تبايع داعش','علنت جماعة بوكو حرام النيجيرية السبت في تسجيل صوتي منسوب لزعيمها مبايعتها زعيم تنظيم  الدولة الإسلامية أبو بكر البغدادي من سمته خليفة المسلمين.\nوأكد شيكاو في التسجيل \"نعلن مبايعة الخليفة على السمع والطاعه فى المنشط والمكره والعسر واليسر\".\nوكان شيكاو أعلن -في شريط مصور بث يوم 13 يوليو/تموز الماضي- دعمه لزعيم تنظيم الدولة الإسلامية أبو بكر البغدادي، الذي يسيطر تنظيمه على مناطق واسعة بالعراق وسوريا أعلن فيها قيام دولة \"الخلافة\".\nوتسيطر بوكو حرام على مناطق بشمال نيجيريا، وكثفت في الأشهر الأخيرة هجماتها عبر الحدود لتشمل الكاميرون والنيجر، في مسعاها لإقامة إمارة إسلامية حول منطقة بحيرة تشاد المتاخمة لنيجيريا وتشاد والكاميرون والنيجر.',NULL,'local',-1,-1,-1.000,1425797492,1425883892,NULL,'Asia/Jerusalem',5,'text','paid',1500.00,'SEK',5,'live',0,41),(43,1425906581,13,'The conflict','We are very interested in how the conflict has affected you, your family and friends. \nHas it changed your life, daily routines or surrounding environment? Please send in photos, video or write a personal story.',NULL,'international',NULL,NULL,NULL,1425906581,1427717381,1427148499,'Europe/Stockholm',10,'photo,text,video,audio','paid',200.00,'USD',5,'closed',0,42),(44,1425907976,13,'American pie','We are interested in what you think is truly great about America.\nIs it perhaps widespread culture, vast canyons or the free market?\nSend in 