/*!50003 CREATE*/ /*!50017 DEFINER=`nrmaster`@`%`*/ /*!50003 TRIGGER `t_afterinsert_on_uploads` AFTER INSERT ON `uploads`
 FOR EACH ROW BEGIN
	IF (NEW.`type` = 'video') THEN
		INSERT INTO `videos`(`id`) VALUES(NEW.`id`);
        ELSEIF (NEW.`type` = 'audio') THEN
                INSERT INTO `audios`(`id`) VALUES(NEW.`id`);
	END IF;
END */;;
