/*!50003 CREATE*/ /*!50017 DEFINER=`nrmaster`@`%`*/ /*!50003 TRIGGER `t_afterinsert_on_users_groups` AFTER INSERT ON `users_groups`
 FOR EACH ROW BEGIN
	IF NEW.`group_id`=2 THEN
			INSERT INTO `sellers`(`id`) VALUES(NEW.`user_id`);
	ELSEIF NEW.`group_id`=3 THEN
			INSERT INTO `buyers`(`id`) VALUES(NEW.`user_id`);
	END IF;
END */;;
